import MyPosts from './MyPosts/MyPosts';
import s from './Profile.module.css';
import ProfileInfo from './ProfileInfo/ProfileInfo';


let postData = [
    { id: 1, message: 'Где деньги, Лебовски?', likes: 20 },
    { id: 2, message: 'Займи косарь', likes: 23 }
]

const Profile = (props) => {
    return (
        <section>
            <div className={s.pictures}>
                <img src='https://allthatsinteresting.com/thumb/1200.633.https://allthatsinteresting.com/wordpress/wp-content/uploads/2013/09/interesting-pictures-of-clouds.jpg' />
            </div>

            <ProfileInfo />
            <MyPosts data={postData}/>
        </section>
    )
}


export default Profile;
